export default function MatchDetailTeamAway() {
    return (
        <div className="rounded-lg flex items-center gap-6 w-fit matchDetailTeam">
            <div className="text-white flex flex-col items-center">
                <span className="text-3xl">⭐</span>
                <p className="text-lg font-bold">(6. místo)</p>
            </div>

            <div className={"imageClub"}>
            <div className="bg-white p-6 rounded-lg shadow-md flex items-center absolute">
                <img
                    src="https://upload.wikimedia.org/wikipedia/en/5/53/Arsenal_FC.svg"
                    alt="Newcastle United Logo"
                    className="h-20 w-20"
                />
            </div>
            </div>

            <div className="bg-white p-3 rounded-lg flex flex-col items-center shadow-md">
                <p className="font-bold text-black">FORM</p>
                {["W", "W", "W", "L", "L"].map((result, index) => (
                    <div
                        key={index}
                        className={`w-8 h-8 flex items-center justify-center text-white font-bold text-lg rounded-full mt-2 ${
                            result === "W" ? "bg-green-500" : "bg-red-500"
                        }`}
                    >
                        {result}
                    </div>
                ))}
            </div>
        </div>
    );
}
